import React from "react";

function DashboardNavBar(){
    return(
        <div className="navBar">
            <ul className="hpURLList">
                <li className="nvUpperRightOptions">
                    <button>
                        <div className="hamburger-icon"></div>
                        <div className="hamburger-icon"></div>
                        <div className="hamburger-icon"></div>
                    </button>
                </li>
                <li className="nvUpperRightOptions"><div id="navbar-logo-container"><img id="navbar-logo" src="./images/virtual-version-log.png"></img></div></li>
                <li className="nvUpperRightOptions">New Document</li>
            </ul>
        </div>
    );
}

export default DashboardNavBar;
